import React, { memo } from 'react';
import PropTypes from 'prop-types';

import { Button, Typography } from '@material-ui/core';

import useStyles from './styled';

const Action = ({ subtitle, buttonTitle }) => {
  const classes = useStyles();

  const styleBox = {
    width: '100%',
    overflow: 'visible',
  };

  return (
    <>
      <div style={styleBox}>
        <Typography className={classes.actionSignUpTitle}>{subtitle}</Typography>
      </div>
      <div style={styleBox}>
        <Button variant="contained" size="large" className={classes.whiteButton}>
          {buttonTitle}
        </Button>
      </div>
    </>
  );
};

Action.defaultProps = {
  subtitle: null,
  buttonTitle: null,
};

Action.propTypes = {
  subtitle: PropTypes.string,
  buttonTitle: PropTypes.string,
};

export default memo(Action);
